(11572, 55, '2025-04-10', 4, 2025, 'Membukakan pintu Ruangan ruangan,membersihkan Tangga dan ngepel,menambah Kursi Citos untuk Syawalan,beres beres meja kursi selesai syawalan,menyiapkan meja dan Karpet untuk pelepasan purna Tugas Bp Iswahyudi,mengontrol lampu,AC dan mengunci pintu Ruangan ruangan.', 6, 'Kegiatan'),
(11573, 9, '2025-04-08', 4, 2025, 'Menyiapkan area Resepsionis, menyambut kedatangan Kepala Kantor Regional I BKN Yogyakarta, menerima dan mencatat konsultasi telepon, menyambut dan mengarahkan tamu ke bidang yang dituju, menerima 1 tamu INKA dan 3 tamu Pensiun', 1, 'Kegiatan'),
(11574, 9, '2025-04-09', 4, 2025, 'Menyiapkan area Resepsionis, menyambut kedatangan Kepala Kantor Regional I BKN Yogyakarta, menerima dan mencatat konsultasi telepon, menyambut dan mengarahkan tamu ke bidang yang dituju, menerima 1 tamu Mutasi, 2 tamu Pensiun, 2 tamu Umum. ', 1, 'Kegiatan'),
(11576, 25, '2025-04-10', 4, 2025, 'Pel kering dan basah lantai loby dan selasar. Dusting meja dan perlengkapan kantor. Membersihkan kamar mandi. Menyiram tanaman.membuang air ac. Mengumpulkan dan membuang sampah ruangan. Membersihkan sarang laba\".', 7, 'Kegiatan'),
(11577, 45, '2025-04-08', 4, 2025, 'Serah terima jaga dari Shift Pagi Regu C,Cek Inventaris Pos,Patroli Area BKN,Cek kondisi pintu-pintu darurat Gedung utama,Penjagaan Loby,Mematikan lampu-lampu,Serah terima jaga ke Shift Pagi Regu B.', 7, 'Dinas Malam'),
(11578, 45, '2025-04-09', 4, 2025, 'Libur', 0, 'Off'),
(11579, 45, '2025-04-10', 4, 2025, 'Serah terima jaga dari Shift Malam Regu C,Cek Inventaris Pos,Penjagaan Area Parkir,Pantau Lalin Area Belakang,Penjagaan Loby,Menyalakan lampu,Cek Inventaris Pos,Serah terima jaga ke Shift Malam Regu B.', 8, 'Dinas Pagi'),
(11580, 45, '2025-04-11', 4, 2025, 'Serah terima jaga dari Shift Pagi Regu C,Cek Inventaris Pos,Patroli Area BKN,Cek kondisi pintu-pintu darurat Gedung utama,Penjagaan Loby,Mematikan lampu-lampu,Serah terima jaga ke Shift Pagi Regu B.', 7, 'Dinas Malam'),
(11581, 45, '2025-04-12', 4, 2025, 'Libur', 0, 'Off'),
(11582, 56, '2025-04-04', 4, 2025, 'Serah terima tugas jaga, cek barang2 invtrs, patroli area, standby pos, menutup gerbang, patroli area, standby dan pemantauan area, membuka gerbang, mematikan lampu, giat bersih2, cek rumdis dan cek barang2 invtrs dilanjutkan serah terima tugas jaga.', 8, 'Stand by dan pengondisian pos rumdis '),
(11583, 56, '2025-04-05', 4, 2025, 'Off', 0, '-'),
(11584, 56, '2025-04-06', 4, 2025, 'Serah terima tugas, cek barang2 invtrs, patroli area, standby pos, patroli area,, menghidupkan lampu, cek Monas dan tornas, cek barang2 invtrs, dilanjutkan serah terima tugas jaga ', 8, 'Standby dan pemantauan area '),
(11585, 56, '2025-04-07', 4, 2025, 'Cuti', 0, '-'),
(11586, 56, '2025-04-08', 4, 2025, 'Off', 0, '-'),
(11587, 56, '2025-04-09', 4, 2025, 'Cuti', 0, '-'),
